import React, { useState } from 'react';
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import { Link } from 'react-router-dom';
import { SidebarData } from './SidebarData';
import '../Navbar.css';
import { IconContext } from 'react-icons';
import { Button } from 'bootstrap';
import { useNavigate } from 'react-router-dom';
import { FaHome } from 'react-icons/fa';
function Navbar() {
  const [sidebar, setSidebar] = useState(false);

  const showSidebar = () => setSidebar(!sidebar);
  const navigate=useNavigate()
  const logout=()=>{
    navigate('/login')
  }
  return (
    <>
      <IconContext.Provider value={{ color: '#fff' }}>
        <div className='navbar bg-success'>
          <Link to='#' className='menu-bars bg-success d-flex flex-row flex-row-reverse'>
            <FaIcons.FaBars onClick={showSidebar} />
          </Link>
        </div>
        <nav className={sidebar ? 'nav-menu active' : 'nav-menu'}>
          <ul className='nav-menu-items bg-success list-unstyled' onClick={showSidebar}>
            <li className='navbar-toggle bg-success'>
              <Link to='#' className='menu-bars'>
                <AiIcons.AiOutlineClose />
              </Link>
            </li>
            <li className='list-unstyled'>
              <div className='d-flex flex-column h-100 justify-content-between'>
              <div className='d-flex flex-column lg-8 mb-5'>
              <Link id="menub"className='text-decoration-none p-2 font-italic bg-secondery text-success m-2 shadow-sm border-success rounded-2' to="/home" ><FaHome/>Home</Link>
              <Link id="menub" className='text-decoration-none p-2 font-italic bg-white text-success m-2 shadow-sm border-success rounded-2' to="/recommendation" >Recomendation</Link>
              <Link id="menub" className='text-decoration-none p-2 font-italic bg-white text-success m-2 shadow-sm border-success rounded-2' to="/favourites"  >Favourites</Link>
              </div>
              <div className='lg-4 mt-5 d-flex ml-2'>
                <button className='bg-success shadow rounded-2 border-white m-2 p-2' onClick={logout}>Logout</button>
         
              </div>
              </div>
            </li>


          </ul>
        </nav>
      </IconContext.Provider>
    </>
  );
}

export default Navbar;
